Object.Field:
BEGIN
EXECUTE IMMEDIATE 'ALTER SESSION SET NLS_DATE_FORMAT = "YYYY-MM-DD HH24:MI:SS"';
MERGE INTO OPR_INCIDENT_DTLS F_TAB USING ( SELECT * FROM STG_OPR_INCIDENT_DTLS WHERE (INCIDENT_NUMBER,LAST_UPDATED) IN (SELECT INCIDENT_NUMBER,MAX(LAST_UPDATED) FROM STG_OPR_INCIDENT_DTLS GROUP BY INCIDENT_NUMBER) ) STG_TAB ON (F_TAB.INCIDENT_NUMBER = STG_TAB.INCIDENT_NUMBER) WHEN MATCHED THEN UPDATE SET F_TAB.CREATED = TO_DATE(TRIM(STG_TAB.CREATED)), F_TAB.CREATED_DT = TO_DATE(SUBSTR(TRIM(STG_TAB.CREATED_DT),0,10)), F_TAB.STATE = STG_TAB.STATE, F_TAB.ON_HOLD_SUB_STATE = STG_TAB.ON_HOLD_SUB_STATE, F_TAB.REPORTED_CI = STG_TAB.REPORTED_CI, F_TAB.ASSIGNMENT_GROUP = STG_TAB.ASSIGNMENT_GROUP, F_TAB.ASSIGNED_TO = STG_TAB.ASSIGNED_TO, F_TAB.RESOLVED = TO_DATE(TRIM(STG_TAB.RESOLVED)), F_TAB.SHORT_DESCRIPTION = STG_TAB.SHORT_DESCRIPTION, F_TAB.URGENCY = STG_TAB.URGENCY, F_TAB.PROBLEM = STG_TAB.PROBLEM, F_TAB.PRIORITY = STG_TAB.PRIORITY, F_TAB.LAST_UPDATED = TO_DATE(TRIM(STG_TAB.LAST_UPDATED)), F_TAB.ESCALATION = STG_TAB.ESCALATION, F_TAB.DURATION = TO_NUMBER(TRIM(STG_TAB.DURATION)), F_TAB.RESOLVING_COMPANY = STG_TAB.RESOLVING_COMPANY, F_TAB.CHILD_INCIDENTS = STG_TAB.CHILD_INCIDENTS, F_TAB.CAUSING_CHANGE = STG_TAB.CAUSING_CHANGE, F_TAB.REOPEN_COUNT = STG_TAB.REOPEN_COUNT, F_TAB.RESOLVE_CODE = STG_TAB.RESOLVE_CODE, F_TAB.REOPENED = STG_TAB.REOPENED, F_TAB.SYMPTOM = STG_TAB.SYMPTOM, F_TAB.SET_TO_P1 = STG_TAB.SET_TO_P1, F_TAB.SLA_DUE = TO_DATE(TRIM(STG_TAB.SLA_DUE)), F_TAB.SLA_MET = STG_TAB.SLA_MET WHERE TO_DATE(TRIM(STG_TAB.LAST_UPDATED)) > F_TAB.LAST_UPDATED WHEN NOT MATCHED THEN INSERT ( F_TAB.INCIDENT_NUMBER, F_TAB.CREATED, F_TAB.CREATED_DT, F_TAB.STATE, F_TAB.ON_HOLD_SUB_STATE, F_TAB.REPORTED_CI, F_TAB.ASSIGNMENT_GROUP, F_TAB.ASSIGNED_TO, F_TAB.RESOLVED, F_TAB.SHORT_DESCRIPTION, F_TAB.URGENCY, F_TAB.PROBLEM, F_TAB.PRIORITY, F_TAB.LAST_UPDATED, F_TAB.ESCALATION, F_TAB.DURATION, F_TAB.RESOLVING_COMPANY, F_TAB.CHILD_INCIDENTS, F_TAB.CAUSING_CHANGE, F_TAB.REOPEN_COUNT, F_TAB.RESOLVE_CODE, F_TAB.REOPENED, F_TAB.SYMPTOM, F_TAB.SET_TO_P1, F_TAB.SLA_DUE, F_TAB.SLA_MET ) VALUES ( STG_TAB.INCIDENT_NUMBER, TO_DATE(TRIM(STG_TAB.CREATED)), TO_DATE(SUBSTR(TRIM(STG_TAB.CREATED_DT),0,10)), STG_TAB.STATE, STG_TAB.ON_HOLD_SUB_STATE, STG_TAB.REPORTED_CI, STG_TAB.ASSIGNMENT_GROUP, STG_TAB.ASSIGNED_TO, TO_DATE(TRIM(STG_TAB.RESOLVED)), STG_TAB.SHORT_DESCRIPTION, STG_TAB.URGENCY, STG_TAB.PROBLEM, STG_TAB.PRIORITY, TO_DATE(TRIM(STG_TAB.LAST_UPDATED)), STG_TAB.ESCALATION, TO_NUMBER(TRIM(STG_TAB.DURATION)), STG_TAB.RESOLVING_COMPANY, STG_TAB.CHILD_INCIDENTS, STG_TAB.CAUSING_CHANGE, STG_TAB.REOPEN_COUNT, STG_TAB.RESOLVE_CODE, STG_TAB.REOPENED, STG_TAB.SYMPTOM, STG_TAB.SET_TO_P1, TO_DATE(TRIM(STG_TAB.SLA_DUE)), STG_TAB.SLA_MET ); END;
